using UniqueUCPTrie = wil::unique_any<UCPTrie*, decltype(&ucptrie_close), &ucptrie_close>;
static const UniqueUCPTrie icuTrie = []() {
    UErrorCode error = U_ZERO_ERROR;
    UniqueUCPTrie trie{ ucptrie_openFromBinary(UCPTRIE_TYPE_FAST, UCPTRIE_VALUE_BITS_8, &s_ucpTrieData[0], _countof(s_ucpTrieData), nullptr, &error) };
    FAIL_FAST_IF_MSG(error > U_ZERO_ERROR, "ucptrie_openFromBinary failed with %hs", u_errorName(error));
    return trie;
}();

// UAX #29 states:
// > Note: Testing two adjacent characters is insufficient for determining a boundary.
//
// I completely agree, but I really hate it. So this code trades off correctness for simplicity
// by using a simple lookup table anyway. Under most circumstances users won't notice,
// because as far as I can see this only behaves different for degenerate ("invalid") Unicode.
// It reduces our code complexity significantly and is way *way* faster.
//
// This is a great reference for the resulting table:
//   https://www.unicode.org/Public/UCD/latest/ucd/auxiliary/GraphemeBreakTest.html
using JoinRules = std::array<std::array<bool, CB_COUNT>, CB_COUNT>;
static constinit JoinRules joinRules = []() {
    // NOTE: We build the table in reverse, because rules with lower numbers take priority.
    // (This is primarily relevant for GB9b vs. GB4.)

    // Otherwise, break everywhere.
    // GB999: Any ÷ Any
    JoinRules rules{};

    // Do not break within emoji flag sequences. That is, do not break between regional indicator
    // (RI) symbols if there is an odd number of RI characters before the break point.
    // GB13: [^RI] (RI RI)* RI × RI
    // GB12: sot (RI RI)* RI × RI
    //
    // We cheat here by not checking that the number of RIs is even. Meh!
    rules[CB_REGIONAL_INDICATOR][CB_REGIONAL_INDICATOR] = true;

    // Do not break within emoji modifier sequences or emoji zwj sequences.
    // GB11: \p{Extended_Pictographic} Extend* ZWJ × \p{Extended_Pictographic}
    //
    // We cheat here by not checking that the ZWJ is preceded by an ExtPic. Meh!
    rules[CB_ZERO_WIDTH_JOINER][CB_EXTENDED_PICTOGRAPHIC] = true;

    // Do not break within certain combinations with Indic_Conjunct_Break (InCB)=Linker.
    // GB9c: \p{InCB=Consonant} [\p{InCB=Extend}\p{InCB=Linker}]* \p{InCB=Linker} [\p{InCB=Extend}\p{InCB=Linker}]* × \p{InCB=Consonant}
    //
    // I'm sure GB9c is great for these languages, but honestly the definition is complete whack. Just look at that chonker!
    // This isn't a "cheat" like the others above, this is a reinvention: We treat it as having both CB_PREPEND and CB_EXTEND properties.
    rules[CB_CONJUNCT_LINKER].fill(true);
    for (auto& lead : rules)
    {
        lead[CB_CONJUNCT_LINKER] = true;
    }

    // Do not break before SpacingMarks, or after Prepend characters.
    // GB9b: Prepend ×
    rules[CB_PREPEND].fill(true);

    // Do not break before SpacingMarks, or after Prepend characters.
    // GB9a: × SpacingMark
    // Do not break before extending characters or ZWJ.
    // GB9: × (Extend | ZWJ)
    for (auto& lead : rules)
    {
        // CodepointWidthDetector_triegen.py sets SpacingMarks to CB_EXTEND as well,
        // since they're entirely identical to GB9's Extend.
        lead[CB_EXTEND] = true;
        lead[CB_ZERO_WIDTH_JOINER] = true;
    }

    // Do not break Hangul syllable sequences.
    // GB8: (LVT | T) x T
    rules[CB_HANGUL_LVT][CB_HANGUL_T] = true;
    rules[CB_HANGUL_T][CB_HANGUL_T] = true;
    // GB7: (LV | V) x (V | T)
    rules[CB_HANGUL_LV][CB_HANGUL_T] = true;
    rules[CB_HANGUL_LV][CB_HANGUL_V] = true;
    rules[CB_HANGUL_V][CB_HANGUL_V] = true;
    rules[CB_HANGUL_V][CB_HANGUL_T] = true;
    // GB6: L x (L | V | LV | LVT)
    rules[CB_HANGUL_L][CB_HANGUL_L] = true;
    rules[CB_HANGUL_L][CB_HANGUL_V] = true;
    rules[CB_HANGUL_L][CB_HANGUL_LV] = true;
    rules[CB_HANGUL_L][CB_HANGUL_LVT] = true;

    // Do not break between a CR and LF. Otherwise, break before and after controls.
    // GB5: ÷ (Control | CR | LF)
    for (auto& lead : rules)
    {
        lead[CB_CONTROL] = false;
    }
    // GB4: (Control | CR | LF) ÷
    rules[CB_CONTROL].fill(false);

    // We ignore GB3 which demands that CR × LF do not break apart, because
    // a) these control characters won't normally reach our text storage
    // b) otherwise we're in a raw write mode and historically conhost stores them in separate cells

    // We also ignore GB1 and GB2 which demand breaks at the start and end,
    // because that's not part of the loops in GraphemeNext/Prev and not this table.
    return rules;
}();

static CodepointWidthDetector widthDetector;

CodepointWidthDetector& CodepointWidthDetector::Singleton() noexcept
{
    return widthDetector;
}

size_t CodepointWidthDetector::GraphemeNext(const std::wstring_view& str, size_t offset, int* width) noexcept
{
    const auto trie = icuTrie.get();
    const auto beg = str.begin();
    const auto end = str.end();
    auto leadPtr = beg + offset;

    if (leadPtr == end)
    {
        return 0;
    }

    UChar32 cp;
    uint8_t lead;
    UCPTRIE_FAST_U16_NEXT(trie, UCPTRIE_8, leadPtr, end, cp, lead);

    int totalWidth = 0;

    for (;;)
    {
        auto w = INTO_CHARACTER_WIDTH(lead);
        // "Unqualified emojis" leave their representation (text/colored) open to the renderer.
        // U+FE0F (variation selector 16) forces colored representation. For any ambiguous width emoji like ®
        // VS-16 is commonly expected to allocate 2 cells, because it'll be drawn as a chunky, colored glyph.
        // Technically we'd have to check if the preceding character was an emoji, but we currently use an optimally packed UCPTRIE_8
        // and adding this 1 bit of information would double its size. Let's wait and see if anyone notices this bug in the first place...
        if (cp == 0xfe0f)
        {
            w = 2;
        }
        if (w == 3)
        {
            w = _checkFallbackViaCache(cp);
        }

        totalWidth += w;

        if (leadPtr == end)
        {
            break;
        }

        auto trailPtr = leadPtr;
        uint8_t trail;
        UCPTRIE_FAST_U16_NEXT(trie, UCPTRIE_8, trailPtr, end, cp, trail);

        const auto leadCB = INTO_CLUSTER_BREAK(lead);
        const auto trailCB = INTO_CLUSTER_BREAK(trail);
        if (!joinRules[leadCB][trailCB])
        {
            break;
        }

        leadPtr = trailPtr;
        lead = trail;
    }

    if (width)
    {
        *width = totalWidth < 1 ? 1 : (totalWidth > 2 ? 2 : totalWidth);
    }
    return leadPtr - beg;
}

// This code is identical to GraphemeNext() but with the order of operations reversed since we're iterating backwards.
size_t CodepointWidthDetector::GraphemePrev(const std::wstring_view& str, size_t offset, int* width) noexcept
{
    const auto trie = icuTrie.get();
    const auto beg = str.begin();
    auto trailPtr = beg + offset;

    if (trailPtr == beg)
    {
        return 0;
    }

    UChar32 cp;
    uint8_t trail;
    UCPTRIE_FAST_U16_PREV(trie, UCPTRIE_8, beg, trailPtr, cp, trail);

    int totalWidth = 1;

    for (;;)
    {
        auto w = INTO_CHARACTER_WIDTH(trail);
        // "Unqualified emojis" leave their representation (text/colored) open to the renderer.
        // U+FE0F (variation selector 16) forces colored representation. For any ambiguous width emoji like ®
        // VS-16 is commonly expected to allocate 2 cells, because it'll be drawn as a chunky, colored glyph.
        // Technically we'd have to check if the preceding character was an emoji, but we currently use an optimally packed UCPTRIE_8
        // and adding this 1 bit of information would double its size. Let's wait and see if anyone notices this bug in the first place...
        if (cp == 0xfe0f)
        {
            w = 2;
        }
        if (w == 3)
        {
            w = _checkFallbackViaCache(cp);
        }

        totalWidth += w;

        if (trailPtr == beg)
        {
            break;
        }

        auto leadPtr = trailPtr;
        uint8_t lead;
        UCPTRIE_FAST_U16_PREV(trie, UCPTRIE_8, beg, leadPtr, cp, lead);

        const auto leadCB = INTO_CLUSTER_BREAK(lead);
        const auto trailCB = INTO_CLUSTER_BREAK(trail);
        if (!joinRules[leadCB][trailCB])
        {
            break;
        }

        trailPtr = leadPtr;
        trail = lead;
    }

    if (width)
    {
        *width = totalWidth < 1 ? 1 : (totalWidth > 2 ? 2 : totalWidth);
    }
    return trailPtr - beg;
}

int CodepointWidthDetector::GetWidth(const std::wstring_view& glyph) noexcept
{
    int width;
    GraphemeNext(glyph, 0, &width);
    return width;
}

// Call the function specified via SetFallbackMethod() to turn CodepointWidth::Ambiguous into Narrow/Wide.
// Caches the results in _fallbackCache. This is _lookupGlyphWidth's even-slower-path.
__declspec(noinline) int CodepointWidthDetector::_checkFallbackViaCache(const char32_t codepoint) noexcept
try
{
    // Ambiguous glyphs are considered narrow by default. See microsoft/terminal#2066 for more info.
    if (!_pfnFallbackMethod)
    {
        return 1;
    }

    if (const auto it = _fallbackCache.find(codepoint); it != _fallbackCache.end())
    {
        return it->second;
    }

    wchar_t buf[2];
    size_t len = 0;
    U16_APPEND_UNSAFE(buf, len, codepoint);

    const uint8_t width = _pfnFallbackMethod({ &buf[0], len }) ? 2 : 1;
    _fallbackCache.insert_or_assign(codepoint, width);
    return width;
}
catch (...)
{
    LOG_CAUGHT_EXCEPTION();
    return 1;
}

// Method Description:
// - Sets a function that should be used as the fallback mechanism for
//      determining a particular glyph's width, should the glyph be an ambiguous
//      width.
//   A Terminal could hook in a Renderer's IsGlyphWideByFont method as the
//      fallback to ask the renderer for the glyph's width (for example).
// Arguments:
// - pfnFallback - the function to use as the fallback method.
// Return Value:
// - <none>
void CodepointWidthDetector::SetFallbackMethod(std::function<bool(const std::wstring_view&)> pfnFallback) noexcept
{
    _pfnFallbackMethod = std::move(pfnFallback);
}

// Method Description:
// - Resets the internal ambiguous character width cache mechanism
//   since it will be different when the font changes and we should
//   re-query the new font for that information.
// Arguments:
// - <none>
// Return Value:
// - <none>
void CodepointWidthDetector::NotifyFontChanged() noexcept
{
#pragma warning(suppress : 26447) // The function is declared 'noexcept' but calls function 'clear()' which may throw exceptions (f.6).
    _fallbackCache.clear();
}
